def create_dif_Histogram(Table, epsilon, CountBins):
  hist = [None] * (len(Table.columns))
  bins = [None] * (len(Table.columns))
  dp_hist = [None] * (len(Table.columns))
  dp_bins = [None] * (len(Table.columns))
  for i in range(len(Table.columns)):
    hist[i], bins[i] = np.histogram(Table[Columns[i]], bins=CountBins[i]) # SizeBin = (float, float)
    #hist[i] = hist[i] / hist[i].sum() #Normalize
    dp_hist[i], dp_bins[i] = dp.histogram(Table[Columns[i]], epsilon=epsilon, bins=CountBins[i])
    #dp_hist[i] = dp_hist[i] / dp_hist[i].sum() #Normalize
  return hist, bins, dp_hist, dp_bins
#a deferentially private histogram for each dimension.

